        <FlexItems>
          <Flex>1</Flex>
          <Flex>1</Flex>
          <Flex>1</Flex>
          <Flex>1</Flex>
          <Flex>1</Flex>
          <Flex>1</Flex>
        </FlexItems>
      </div>
    </Wrap>
  );
}

export default Companies;
